eping its secret safe. As we clambered over tussocks and squeezed through low gorse thickets we knew from the grid reference and GPS that we must be close. We searched and searched. Wr asked the Otherworldly ponies who had materialised from nowhere. We split up and searched individually. We searched again together. We admitted defeat and decided to give up. Then we agreed that I would just have one last look while T waited .... I climbed over a gate and scanned the hedgeline and, oh!  large stone slabs and a musical trickle of water beneath .... The Well of the Little People!!! I let out a shout and T came running, or as close to a run as is possible when traversing clumps of sedge and bracken. There was no mistake. Quietly we each interacted with this magical site in our own ways, and instinctively I drew out this very Hare and placed it on the largest stone above the pure flow of the well. So here it is today in my little front garden, nestling (of course!) against the wildlife pond.";}i:173;a:1:{s:14:"comments_count";i:1;}i:174;a:1:{s:11:"likes_count";i:5;}i:175;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu2ReSDMOz";}i:176;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118730264_867991297060626_8923946017202898747_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=106&_nc_ohc=UYxaA9tIa20AX_uunQj&oh=835e3aeee33afc8ffc9b9b3bbaa71118&oe=5F7D4A30";}i:177;a:1:{s:4:"type";s:5:"image";}i:178;a:1:{s:8:"owner_id";i:3584354448;}i:179;a:1:{s:14:"owner_username";s:0:"";}i:180;a:1:{s:14:"owner_fullname";s:0:"";}i:181;a:1:{s:9:"owner_pic";s:0:"";}i:182;a:1:{s:2:"id";s:19:"2391085502752023732";}i:183;a:1:{s:10:"short_code";s:11:"CEu15ijHuS0";}i:184;a:1:{s:12:"created_time";i:1599259625;}i:185;a:1:{s:7:"caption";s:1245:"ğŸ’–
